import React from 'react';
import './AddImage.css';
import Navbar from '../Home/Navbar/Navbar';

const AddImage = () => {
    return (
        <section>
            <Navbar />
          <div style={{ position: "relative" }} className="addImage p-">
          <div
                style={{
                    position: "absolute",
                    top: "50%",
                    left: "50%",
                    transform: "translate(-50%, -50%)"
                }}
                className="container w-75 text-center">
                <div className=" py-3" id="selectionPart">
                    <h1 className="text-primary">
                        Hi. What do you need to make ?
                    </h1>
                </div>
            </div>
          </div>
        </section>
    );
};

export default AddImage;
